import axios from "./../axios";
import { PATH_API } from "../constant/constant";

const handleLoginAPI = (email, password) => {
    axios.post(PATH_API.BASE_URL + PATH_API.LOGIN_API, { email, password })
        .then(res => {
            console.log(res);
            console.log(res.data);
        })
}

export {
    handleLoginAPI,
}
